import React, { useEffect, useState } from "react";
import axios from "axios";

const Cart = () => {
  const [cartItems, setCartItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);

  useEffect(() => {
    fetchCart();
  }, []);

  const fetchCart = async () => {
    try {
      const response = await axios.get('http://localhost:8000/medical_store_app/cart/');
      console.log('API Response:', response.data);

      const cartItems = response.data.cart_items || [];
      const totalPrice = response.data.total_price || 0;

      setCartItems(cartItems);
      setTotalPrice(totalPrice);

      if (cartItems.length === 0) {
        console.log('Cart is empty.');
      } else {
        console.log('Cart items:', cartItems);
      }
    } catch (error) {
      console.error('Error fetching cart items:', error);
    }
  };

  const handleAddToCart = async (productId) => {
    try {
      await axios.post(`/medical_store_app/cart/add/${productId}/`);
      fetchCart();
    } catch (error) {
      console.error("Error adding item to cart:", error);
    }
  };

  const handleUpdateCart = async (cartId, quantity) => {
    if (quantity <= 0) {
      handleRemoveFromCart(cartId);
      return;
    }
    try {
      await axios.post(`/medical_store_app/cart/update/${cartId}/`, { quantity });
      fetchCart();
    } catch (error) {
      console.error("Error updating cart item:", error);
    }
  };

  const handleRemoveFromCart = async (cartId) => {
    try {
      await axios.delete(`/medical_store_app/cart/remove/${cartId}/`);
      fetchCart();
    } catch (error) {
      console.error("Error removing cart item:", error);
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>Your Cart</h1>
      {cartItems.length === 0 ? (
        <p style={styles.emptyCartMessage}>Your cart is empty.</p>
      ) : (
        <>
          <table style={styles.table}>
            <thead>
              <tr>
                <th style={styles.tableHeader}>Product</th>
                <th style={styles.tableHeader}>Quantity</th>
                <th style={styles.tableHeader}>Price</th>
                <th style={styles.tableHeader}>Actions</th>
              </tr>
            </thead>
            <tbody>
              {cartItems.map((item) => (
                <tr key={item.id}>
                  <td style={styles.tableData}>{item.product.name}</td>
                  <td style={styles.tableData}>
                    <input
                      type="number"
                      value={item.quantity}
                      onChange={(e) =>
                        handleUpdateCart(item.id, parseInt(e.target.value))
                      }
                      style={styles.input}
                    />
                  </td>
                  <td style={styles.tableData}>{item.product.price}</td>
                  <td style={styles.tableData}>
                    <button
                      onClick={() => handleRemoveFromCart(item.id)}
                      style={styles.button}
                    >
                      Remove
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
          <h3 style={styles.total}>Total: ${totalPrice}</h3>
        </>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "46px",
    fontFamily: "Arial, sans-serif",
  },
  heading: {
    textAlign: "center",
    fontSize: "2rem",
    marginBottom: "20px",
  },
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginBottom: "20px",
  },
  tableHeader: {
    backgroundColor: "#f4f4f4",
    padding: "10px",
    textAlign: "left",
    fontWeight: "bold",
  },
  tableData: {
    padding: "10px",
    borderBottom: "1px solid #ddd",
  },
  input: {
    padding: "5px",
    width: "50px",
    textAlign: "center",
    borderRadius: "5px",
    border: "1px solid #ddd",
  },
  button: {
    backgroundColor: "#ff4d4d",
    color: "white",
    border: "none",
    padding: "5px 10px",
    borderRadius: "5px",
    cursor: "pointer",
  },
  total: {
    fontSize: "1.5rem",
    textAlign: "right",
    marginTop: "20px",
    fontWeight: "bold",
  },
  emptyCartMessage: {
    textAlign: "center",
    fontSize: "1.2rem",
    color: "#888",
    marginTop: "20px",
  },
};

export default Cart;
